function isOfLowImportance(){
    
    if(nearestWinterStormAlert === null){
        return;
    }
  
    var phenomenaCode = nearestWinterStormAlert.phenomenaCode;
    var significanceCode = nearestWinterStormAlert.significanceCode;
    
    //level 3 alerts that should not be hero
    if((phenomenaCode === "RP" && significanceCode === "S") //Rip Current Statement
    || (phenomenaCode === "TSL" && significanceCode === "S") //Special Weather Statement (US)
    || (phenomenaCode === "weather" && significanceCode === "S") //Special Weather Statement (CA)
    || (phenomenaCode === "HY" && significanceCode === "S") //Hydrologic Statement
    || (phenomenaCode === "TTP" && significanceCode === "S")){ //Tropical Weather Statement
        return true;
    }
    
    return false;
}

function startsInNext5Days() {
     if(nearestWinterStormAlert === null || context.weatherSummary.observation === null || context.weatherSummary.observation.obsTime === null || nearestWinterStormAlert.endTime === null){
        return false;
    }
    
    var endTime = new Date(nearestWinterStormAlert.endTime);
    var obsTime = new Date(context.weatherSummary.observation.obsTime);
        
    //if effectiveTime is null then the alert has already started
    if(nearestWinterStormAlert.effectiveTime === null){
        return obsTime <= endTime;
    } else {
    var startTime = new Date(nearestWinterStormAlert.effectiveTime);
    var next5Days = new Date(obsTime);
    next5Days.setHours(obsTime.getHours() + (24 - obsTime.getHours()) + (4 * 24));//today + remaining hours + next 4 days
    //need to update rule to not break day light savings
    return startTime.getTime() <= next5Days.getTime();
    }
}

